	 (1,'evaluation','<p style="text-align: justify; ">Observo la cuadrícula y contesto las preguntas. </p><ul><li style="text-align: justify;"><b>¿Con qué letra se identifica la línea horizontal?</b></li><li style="text-align: justify;"><b>¿Con qué letra se identifica la línea vertical?</b></li><li style="text-align: justify;"><b> ¿Qué elemento se encuentra entre el par ordenado (5; 1)?</b></li><li style="text-align: justify;"><b>¿En qué par ordenado está ubicado el cofre del tesoro?</b></li></ul><p style="text-align: center;"><img src="data:image/png;base64," data-filename="5.png" style="width: 672px;"></p><p style="text-align: left;"><br></p>','"{\"1\":\"X, Y, Barco, 4:3\",\"2\":\"Y, X, Tesoro, 3:4\",\"3\":\"W, Z, Castillo, 4:2\",\"4\":\"Z, A, Bota, 3:5\"}"','"{\"1\":\"1\",\"2\":\"0\",\"3\":\"0\",\"4\":\"0\"}"','2021-04-05 18:14:18',NULL,NULL,1,NULL,0,'2021-04-05 18:24:03'),
	 (1,'reinforcement_evaluation','<p style="text-align: justify; ">Leo la información y analizo en la tabla el par ordenado que le corresponde a cada estudiante. </p><p style="text-align: justify; ">Luego, verifico si los materiales que los estudiantes reciclaron están ubicados correctamente en el sistema de coordenadas. </p><p style="text-align: justify; ">Escojo la respuesta correcta.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p style="text-align: justify; ">Con el fin de reducir la contaminación ambiental, 4 estudiantes de quinto año reciclaron diferentes deshechos.</p><p style="text-align: justify; "><img src="data:image/png;base64," data-filename="6.png" style="width: 643px;"></p><p style="text-align: justify; "><img src="data:image/png;base64," data-filename="7.png" style="width: 972px;"><br></p>','"{\"1\":\"Todos los pares ordenados estan correctos.\",\"2\":\"Las fundas estan mal ubicadas\",\"3\":\"Los cartones y las latas estan mal ubicadas\",\"4\":\"Las botellas estan mal ubicadas\"}"','"{\"1\":\"1\",\"2\":\"0\",\"3\":\"0\",\"4\":\"0\"}"','2021-04-05 18:14:18',NULL,NULL,1,NULL,0,'2021-04-05 18:24:03'),
