	 (7,'evaluation','<p>Cotopaxi es una de las 24 provincias de nuestro pa&iacute;s, tiene una superficie de 65 690 000 dec&aacute;metros cuadrados (dam2 ). Entre sus atractivos tur&iacute;sticos est&aacute;n el volc&aacute;n Cotopaxi, con una altura de 5 897 m sobre el nivel del mar, y el Quilotoa, que tiene una elevaci&oacute;n de 3 914 m sobre el nivel del mar.&nbsp; &nbsp;Selecionar la opci&oacute;n correcta</p>
