	 (7,'reinforcement_evaluation','<p>Con base en el texto, selecciono la opci&oacute;n correcta, determino si el peso de la ballena azul y el n&uacute;mero de cet&aacute;ceos est&aacute;n escritos correctamente.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;El animal m&aacute;s grande y pesado del mundo es<br />
la ballena azul. En 1947, una flota ballenera<br />
sovi&eacute;tica captur&oacute; una ballena hembra con un<br />
peso aproximado de 185 000 000 gramos.<br />
Se conoce que en la Ant&aacute;rtida, la poblaci&oacute;n m&aacute;s numerosa de estos cet&aacute;ceos era<br />
de 239 000; pero por la falta de conciencia<br />
del ser humano, actualmente existen aproximadamente 2 000 ejemplares, distribuidos<br />
en todo el mundo.&nbsp;</p>

<p><img alt="" src="data:image/png;base64," /></p>
